import { useEffect, useMemo, useRef, useState } from "react";
import { Link, useLocation, useNavigate } from "react-router-dom";
import { useIsMobile } from "../Core/hooks";

import { RxLightningBolt } from "react-icons/rx";
import { IoAnalytics, IoListSharp, IoPeople } from "react-icons/io5";
import { MdAutoStories } from "react-icons/md";
import { BiConversation } from "react-icons/bi";

const colors = {
  bg: "rgba(15,15,18,0.95)",
  border: "rgba(255,255,255,0.08)",
  text: "#fff",
  subText: "rgba(255,255,255,0.75)",
  accent: "#ff6a00",
};

function Navigation() {
  const navigate = useNavigate();
  const location = useLocation();
  const isMobile = useIsMobile();

  const [mobileOpen, setMobileOpen] = useState(false);
  const [toolsOpen, setToolsOpen] = useState(false);
  const [aboutOpen, setAboutOpen] = useState(false);

  const navRef = useRef<HTMLDivElement | null>(null);

  useEffect(() => {
    setMobileOpen(false);
    setToolsOpen(false);
    setAboutOpen(false);
  }, [location.pathname]);

  useEffect(() => {
    const handleClick = (e: MouseEvent) => {
      if (!navRef.current?.contains(e.target as Node)) {
        setToolsOpen(false);
        setAboutOpen(false);
      }
    };
    document.addEventListener("mousedown", handleClick);
    return () => document.removeEventListener("mousedown", handleClick);
  }, []);

  const tools = useMemo(
    () => [
      { label: "Actions", icon: <RxLightningBolt />, path: "/tools/actions" },
      { label: "Data", icon: <IoAnalytics />, path: "/tools/data" },
      { label: "Lists", icon: <IoListSharp />, path: "/tools/lists" },
      { label: "Stories", icon: <MdAutoStories />, path: "/tools/stories" },
      { label: "Meetings", icon: <BiConversation />, path: "/tools/meetings" },
      { label: "People", icon: <IoPeople />, path: "/tools/people" },
    ],
    []
  );

  const navLinkStyle = {
    color: colors.text,
    textDecoration: "none",
    fontWeight: 600,
    fontSize: 14,
    cursor: "pointer",
  };

  return (
    <header
      ref={navRef}
      style={{
        position: "sticky",
        top: 0,
        zIndex: 50,
        background: "transparent",
      }}
    >
      {/* Top bar */}
      <div
        style={{
          maxWidth: 1200,
          margin: "0 auto",
          padding: "12px 18px",
          display: "flex",
          alignItems: "center",
          justifyContent: "space-between",
        }}
      >
        <Link to="/" style={{ display: "flex", alignItems: "center" }}>
          <img
            src="/images/sales-doing-logo-white-red-flame.png"
            alt="SalesDoing"
            style={{ width: 96 }}
          />
        </Link>

        {/* Desktop nav */}
        {!isMobile && (
          <nav style={{ display: "flex", alignItems: "center", gap: 18 }}>
            {/* Tools */}
            <div style={{ position: "relative" }}>
              <button
                onMouseEnter={() => setToolsOpen(true)}
                onMouseLeave={() => setToolsOpen(false)}
                style={{
                  ...navLinkStyle,
                  background: "none",
                  border: 0,
                }}
              >
                Tools ▾
              </button>

              {toolsOpen && (
                <div
                  style={{
                    position: "absolute",
                    top: "calc(100% + 12px)",
                    right: 0,
                    background: colors.bg,
                    border: `1px solid ${colors.border}`,
                    borderRadius: 16,
                    padding: 12,
                    width: 360,
                    display: "grid",
                    gridTemplateColumns: "1fr 1fr",
                    gap: 10,
                    boxShadow: "0 18px 60px rgba(0,0,0,.45)",
                  }}
                >
                  {tools.map((t) => (
                    <button
                      key={t.path}
                      onClick={() => navigate(t.path)}
                      style={{
                        display: "flex",
                        alignItems: "center",
                        gap: 8,
                        background: "rgba(255,255,255,.04)",
                        border: `1px solid ${colors.border}`,
                        borderRadius: 12,
                        padding: 10,
                        color: colors.text,
                        cursor: "pointer",
                      }}
                    >
                      {t.icon}
                      {t.label}
                    </button>
                  ))}
                </div>
              )}
            </div>

            <Link to="/integrations" style={navLinkStyle}>Integrations</Link>
            <Link to="/advisors" style={navLinkStyle}>Advisors</Link>

            {/* About */}
            <div style={{ position: "relative" }}>
              <button
                onMouseEnter={() => setAboutOpen(true)}
                onMouseLeave={() => setAboutOpen(false)}
                style={{
                  ...navLinkStyle,
                  background: "none",
                  border: 0,
                }}
              >
                About ▾
              </button>

              {aboutOpen && (
                <div
                  style={{
                    position: "absolute",
                    top: "calc(100% + 12px)",
                    right: 0,
                    background: colors.bg,
                    border: `1px solid ${colors.border}`,
                    borderRadius: 14,
                    padding: 10,
                    width: 220,
                  }}
                >
                  {[
                    ["/about", "About SalesDoing"],
                    ["/case-studies", "Case Studies"],
                    ["/contact", "Contact"],
                  ].map(([path, label]) => (
                    <button
                      key={path}
                      onClick={() => navigate(path)}
                      style={{
                        width: "100%",
                        textAlign: "left",
                        background: "none",
                        border: 0,
                        padding: 10,
                        color: colors.text,
                        cursor: "pointer",
                      }}
                    >
                      {label}
                    </button>
                  ))}
                </div>
              )}
            </div>

            <Link to="/pricing" style={navLinkStyle}>Pricing</Link>
            <Link to="/login" style={navLinkStyle}>Login</Link>

            <button
              onClick={() => navigate("/register")}
              style={{
                padding: "10px 16px",
                borderRadius: 999,
                border: 0,
                fontWeight: 800,
                background: colors.accent,
                cursor: "pointer",
              }}
            >
              START FOR FREE
            </button>
          </nav>
        )}

        {/* Mobile hamburger */}
        {isMobile && (
          <button
            onClick={() => setMobileOpen((v) => !v)}
            style={{
              width: 44,
              height: 44,
              borderRadius: 12,
              background: "none",
              border: `1px solid ${colors.border}`,
              color: colors.text,
              fontSize: 22,
            }}
          >
            ☰
          </button>
        )}
      </div>

      {/* Mobile menu */}
      {isMobile && mobileOpen && (
        <div
          style={{
            background: colors.bg,
            borderTop: `1px solid ${colors.border}`,
            padding: 14,
          }}
        >
          {[
            ["/integrations", "Integrations"],
            ["/advisors", "Advisors"],
            ["/pricing", "Pricing"],
            ["/login", "Login"],
          ].map(([path, label]) => (
            <button
              key={path}
              onClick={() => navigate(path)}
              style={{
                width: "100%",
                padding: 12,
                borderRadius: 12,
                background: "rgba(255,255,255,.04)",
                border: `1px solid ${colors.border}`,
                color: colors.text,
                marginBottom: 8,
                cursor: "pointer",
              }}
            >
              {label}
            </button>
          ))}

          <button
            onClick={() => navigate("/register")}
            style={{
              width: "100%",
              padding: 14,
              borderRadius: 14,
              border: 0,
              background: colors.accent,
              fontWeight: 800,
              cursor: "pointer",
            }}
          >
            START FOR FREE
          </button>
        </div>
      )}
    </header>
  );
}

export default Navigation;
